  input: TEXT,F3XA,,"We are amending this report in reference to a letter from Report
    Analysis dated May 14, 2003.  Regarding receipts from collection agents, our political
    action committee has several credit unions which sale coins to its membership.  The
    Ky Credit Union League PAC pays for the coins, and the entire proceed goes to
    the PAC.  Therefore, this does not fall under the 1/3rd rule.  No members have
    purchased an aggregate amount of $200 in the year.  In addition, these credit
    unions serve as collecting agents for its employees payroll deductions."
